import { Row } from 'antd';
import Post from '../components/Post';

function Posts() {
  const posts = [
    {
      id: '1',
      title: 'My first post',
      description: 'My first description',
      menu: 'Todays menu!',
    },
    {
      id: '2',
      title: 'My Second post',
      description: 'My second description',
      menu: 'Todays menu!',
    },
  ];
  return (
    <Row>
      <Col>
        {posts.map((post) => (
          <Post
            key={post.id}
            title={post.title}
            description={post.description}
          />
        ))}
      </Col>
    </Row>
  );
}

export default Posts;
